/** 
 * The State enum describes the state of a Gesture.
 * @property ENDED Indicates that the user ended a gesture.
 * @property CANCELED Indicates that the gesture in progress was canceled.
 * @property FAILED Indicates that the gesture in progress failed.
 * @property CHANGED Indicates that the gesture in progress was changed.
 * @property BEGAN Indicates that the user began creating a gesture.
 */ 
declare interface State{ 
ENDED, 
CANCELED, 
FAILED, 
CHANGED, 
BEGAN, 
} 
